			.expire {
				display: inline-block;
				vertical-align: top;
				width: 100px;
				height: 50px;
				position: relative;
				background: #888;
				animation: timer-warning 1s 1;
				animation-fill-mode: forwards;
				animation-delay: 50s;
				margin-bottom: 6px;
				border-radius: 3px;
			}

			.expire>.timer {
				position: absolute;
				top: 0;
				left: 0;
				width: 100px;
				overflow: hidden;
			}

			.expire>.timer>.time-part-wrapper {
				display: inline-block;
				vertical-align: top;
				height: 50px;
				line-height: 50px;
				color: #fff;
